import React from 'react';
import PropTypes from 'prop-types';
Image

const Photos = ({ photos }) => {
  return (
    <>
      <Image.Group size='medium'>
        {photos &&
          photos.map((photo) => (
            <Image key={photo.id} alt='' src={photo.slug} />
          ))}
      </Image.Group>
    </>
  );
};

Photos.propTypes = {
  photos: PropTypes.array.isRequired,
};

export default Photos;
